import { IonAlert, IonButton, IonCard, IonCardContent, IonCol, IonGrid, IonInput, IonRow } from '@ionic/react';
import './TempoSettings.css';
import { useState, useRef, useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { assignBpm, assignDenominator, assignNumerator } from '../store/reducers/tempoSlice';
interface TempoSettingsParameter{
    bpm: number;
    numerator: number;
    denominator: number;
} 

const MetronomeAudio: React.FC = () => {
    const tempo: TempoSettingsParameter = useSelector((state: any) => state.tempo);
    const callAction = useDispatch();
    
    const stop = () => {
        started = false;
        console.log(started);
        beat = 1;
        console.log("Stop!");
    }
    const start = () => {
        if (!started){
            console.log("Starting");
            started = true;
            millis = calculateMillis();
            
            playMetronome();
        }
    }
    const bpmChange = useSelector((tempo:TempoSettingsParameter ) => { if (started){ stop(); }} );
    const numeratorChange  = useSelector((tempo:TempoSettingsParameter ) => { if (started){ stop(); } });
    const denominatorChange = useSelector((tempo:TempoSettingsParameter ) => { if (started){ stop(); } } );

    //Reference a oggetti audio nel jsx
    const tac1 = useRef(null);
    const tac2 = useRef(null);
    const tac3 = useRef(null);
    const tac4 = useRef(null);

    const tic1 = useRef(null);
    const tic2 = useRef(null);
    const tic3 = useRef(null);
    const tic4 = useRef(null);


    const audioTac = [ tac1, tac2, tac3, tac4]; //array di oscillatori per il Tac
    const audioTic = [tic1, tic2, tic3, tic4]; // array di oscillatori per il tic
    var beat = 1; //beat per il tic
    var currentTac = 4; //Oscillatore corrente per tac
    var currentTic = 4; //oscillatore corrente per tic
    var millis = 500;
    var started = false;

    useEffect( () => {  }, [bpmChange, numeratorChange, denominatorChange] );


    const playTac = () => {
        currentTac = currentTac >= 3 ? 0 : currentTac + 1;
        if (audioTac[currentTac].current != null) {
            audioTac[currentTac].current.play();
        }
    }
    const playTic = () => {
        currentTic = currentTic >= 3 ? 0 : currentTic + 1;
        if (audioTic[currentTic].current != null) {
            audioTic[currentTic].current.play();
        }
    }
    const playMetronome = () => {
        if (started){
            console.log("playMetronome: started=" + started);
            if (beat == 1){
                playTic();
            }
            else {
                playTac();
            }
            beat++;
            if (beat > tempo.numerator){
                beat = 1;
            }
            setTimeout(() => { playMetronome() }, millis);
        }
    }

    

    const calculateMillis = () => {
        var oneMinuteMillis = 60000;
        millis = oneMinuteMillis / tempo.bpm;

        return millis;
    }
    return (
        <>
            <IonButton onClick={() => start()}>Start</IonButton>&nbsp; <IonButton onClick={() => stop()}>Stop</IonButton>
            <audio preload="auto" className="hidden" ref={tic1} id="tic1" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto"  className="hidden" ref={tic2} id="tic2" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto" className="hidden" ref={tic3} id="tic3" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto" className="hidden" ref={tic4} id="tic4" src="data:audio/mp3;base64,"></audio>

            <audio preload="auto" className="hidden" ref={tac1} id="tac1" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto" className="hidden" ref={tac2} id="tac2" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto" className="hidden" ref={tac3} id="tac3" src="data:audio/mp3;base64,"></audio>
            <audio preload="auto" className="hidden" ref={tac4} id="tac4" src="data:audio/mp3;base64,"></audio>
         



        </>
    );
}

export default MetronomeAudio;